import styled from "styled-components";

export const StyledContainer = styled.section`
  height: 100vh;
  width: 100%;
  background-color: var(--gray-1);
  display: flex;
`;

export const StyledContent = styled.section`
  width: 90%;
  max-width: 1200px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  margin: 0 auto;
  gap: 30px;
  margin-top: 100px;
`;
